import React, { Component } from "react";
import img1 from "../img/nature3.jpg";
import KiallitasokService from "../service/KiallitasokService";

class KapcsolatComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      kiallitasok: [],
    };
  }
  componentDidMount() {
    KiallitasokService.getKiallitasok()
      .then((res) => {
        this.setState({ kiallitasok: res.data });
        console.log(this.state);
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
  }
  render() {
    return (
      <div>
        <table className="tagokTable">
          <thead>
            <tr>
              <th>Localitate</th>

              <th>Începe</th>

              <th>Se termină</th>
            </tr>
          </thead>
          <tbody>
            {this.state.kiallitasok.map((kiallitas) => (
              <tr key={kiallitas.id}>
                <td>{kiallitas.helyseg}</td>
                <td>{kiallitas.kezdodatum}</td>
                <td>{kiallitas.vegdatum}</td>
                <td>
                  <button className="infoBtn" id={kiallitas.id}>
                  </button>
                  <button
                    className="infoBtn"
                    onClick={() => this.deletekiallitas(kiallitas.id)}
                    id={kiallitas.id}
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default KapcsolatComponent;
